def insert_proxy_groups(conn):
    params = [
        {"id": 1, "name": "🎯 Direct", "tag": "built-in", "type": "select", "builtin": True, "proxies": "DIRECT,REJECT,#2,...", "settings": {}},
        {"id": 2, "name": "🌏 Proxy", "tag": "built-in", "type": "select", "builtin": True, "proxies": "...", "settings": {}},
        {"id": 3, "name": "🐳 Match", "tag": "built-in", "type": "select", "builtin": True, "proxies": "#2,#1,#4,...", "settings": {}},
        {"id": 4, "name": "❌ Reject", "tag": "built-in", "type": "select", "builtin": True, "proxies": "REJECT,#1,#2,...", "settings": {}},
    ]
    stmt = insert(ClashProxyGroup).values(
        id=bindparam("id"),
        name=bindparam("name"),
        tag=bindparam("tag"),
        type=bindparam("type"),
        builtin=bindparam("builtin"),
        proxies=bindparam("proxies"),
        settings=bindparam("settings"),
        modified_at=datetime.utcnow()
    )
    conn.execute(stmt, params)

ruleset_id = 0

def insert_ruleset(conn, name, builtin, policy, rules):
    global ruleset_id
    ruleset_id = ruleset_id + 1
    conn.execute(insert(ClashRuleset), {
        "id": ruleset_id,
        "name": name,
        "builtin": builtin,
        "policy": policy,
        "settings": {},
        "modified_at": datetime.utcnow(),
    })
    params = []
    for line in rules:
        rule = str(line).split(",")
        rule.append("") # no-resolve
        rule.append("") # policy
        params.append({
            "type": rule[0],
            "content": rule[1],
            "option": rule[2],
            "policy": rule[3],
        })
    if params:
        conn.execute(insert(ClashRule).values(
            type=bindparam("type"),
            content=bindparam("content"),
            option=bindparam("option"),
            policy=bindparam("policy"),
            ruleset_id=ruleset_id,
            priority=0,
            modified_at=datetime.utcnow(),
        ), params)

